'''
leetcode #846 hand-of-straights 一手顺子
https://leetcode-cn.com/contest/weekly-contest-87/problems/hand-of-straights/
'''
class Solution:
    def isNStraightHand(self, hand, W):
        """
        :type hand: List[int]
        :type W: int
        :rtype: bool
        """
        l = len(hand)
        if l == 1 and W == 1:
            return True
        if W > l/2 and W != l:
            return False
        if l % W != 0:
            return False

        m = dict()
        for k,v in enumerate(hand):
            m[v] = m.get(v, 0) + 1

        li = sorted(m.items())
        w = W
        start = 0
        while True:
            if w != W:
                return False
            if start >= len(li) - 1 and li[-1][1] == 0:
                return True
            w = 0
            num = -1

            for i in range(start, len(li)):
                k, v = li[i]

                if w == W:
                    break
                if v <= 0:
                    continue
                if num != -1 and k != num + 1:
                    return False
                num = k
                w = w + 1
                li[i] = (k,v - 1)
                if li[i][1] <= 0:
                    start = i
                # print(start, num, li)
        return True

